  false,\n\t\"url\": null,\n\t\"notes\": \"This report documents the results of a
  project undertaken through this cooperative agreement to inventory the Rappahannock
  River Valley National Wildlife Refuge potential acquisition area for: 1) Species
  federally listed by the US Fish and Wildlife Service in the categories of Endangered
  or Threatened, Proposed Threatened or Endangered, and Candidate. 2) Species state
  listed by Virginia in the categories of Endangered, Threatened, Special Concern,
  and Candidate. 3) Natural Heritage Program species with specific global and state
  rankings.  The practical goal of the inventory is to assist refuge personnel in
  making management and land use decisions such as establishing priorities for land
  acquisition, the sitting of  facilities, recreational use of refuge lands, invasive
  species control priorities,  vegetation management, and management of areas containing
  natural heritage  resources.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
